import React from 'react'
import './CSS/Loginsignup.css'
import httpClient from '../httpClient'
import { useState,useEffect } from 'react'
import {User} from '../types'
import { Link} from 'react-router-dom'

export const Loginsignup = (props) => {
  const [email, setEmail]= useState('')
  const [password, setPassword]= useState('')


  const logInUser = async ()=>
  {
    console.log(email, password);
    try {
      const resp = await httpClient.post("//localhost:5000/login", {
        email,
        password
      });
      window.location.href = "/";
    } catch(error){
      if(error.response && (error.response.status === 403 || error.response.status === 401)){
        alert("Invalid Email or Password")
      }
    }
  };

  return (
    <body>
    <div className='login'>
      <div class="login-box">
    <h2>Login</h2>
    <div class="textbox">
        <input type="text" placeholder="Email" value={email} name='email' onChange={(e)=>setEmail(e.target.value)} required/>
    </div>
    <div class="textbox">
        <input type="password" placeholder="Password" value={password} name='password' onChange={(e)=>setPassword(e.target.value)} required/>
    </div>
    <div class="remember-me">
        <input type="checkbox" id="remember" name="remember"/>
        <label for="remember">Remember Me</label>
    </div>
    <button type="button" class="btn" onClick={logInUser}>Login</button>
        </div>
      <div className="login-link">
            <a> <Link to='/signup'>New Customer?</Link></a>
        </div>

    </div>
    </body>
  )
}
export default Loginsignup
